import 'package:flutter/material.dart';

class BothView extends StatefulWidget {
  BothView({super.key});

  @override
  State<BothView> createState() => _BothViewState();
}

class _BothViewState extends State<BothView> {
  bool isGrid = true;
  List<String> city = [
    'Rajkot',
    'Morbi',
    'Ahemdabad',
    'Surat',
    'Amreli',
    'abc',
    'Rajkot',
    'Morbi',
    'Ahemdabad',
    'Surat',
    'Amreli',
    'abc'
  ];

  List<String> img = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
  ];
  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        backgroundColor: Colors.black54,
        title: Text(
          "Changable View",
          style: TextStyle(fontSize: 30, color: Colors.white),
        ),
        actions: [
          IconButton(
            onPressed: () {
              setState(() {
                isGrid = !isGrid;
              });
            },
            icon: Icon(
              color: Colors.white,
              isGrid?Icons.list:Icons.grid_3x3_outlined
            ),
          ),
        ],
      ),
      body: isGrid
          ? GridView.builder(
              itemCount: city.length,
              gridDelegate:
                  SliverGridDelegateWithFixedCrossAxisCount(crossAxisCount: 3),
              itemBuilder: (context, index) {
                return Card(
                  elevation: 30,
                  color: Colors.white,
                  shape: OutlineInputBorder(borderRadius: BorderRadius.circular(30),borderSide: BorderSide(color: Colors.white)),
                  child: Column(
                    children: [
                      GridTile(child: Text(city[index],style: TextStyle(fontSize: 30),)),
                      Center(child: GridTile(child: Image.network(img[index])))
                    ],
                  ),
                );
              },
            )
          : ListView.builder(
              itemCount: city.length,
              itemBuilder: (context, index) {
                return ListTile(
                    leading: Image.network(img[index]),
                    title: Text(city[index]));
              },
            ),
    );
  }
}
